import React from 'react'
import {useSelector} from 'react-redux'

function Profile() {
    const {name,age,status}=useSelector((state)=>{
        console.log(state)
        return state
    })
    
  return (
    <div>
        <h1> I am profile component</h1>
        <h2>{name}</h2>
        <h2>{age}</h2>
        <h2>{status}</h2>
    </div>
  )
}

export default Profile
